import IconButton from "@mui/material/IconButton";
import Stack from "@mui/material/Stack";
import SaveSeller from "../helpers/SaveSeller";
import { GetSeller } from "../helpers/GetSeller";
import SellerUpdateForm2 from "./SellerUpdateForm2";

const SellerUpdateForm = ({idcliente}) => {

    const [profile, setprofile] = useState({
    pickupaddress: "",
    legaladdress: "",
    id_cliente: idcliente,
    legalname: "",
    dbaname: "",
    tipocorporacion: "",
    tax_id: "",
    contactname: "",
    cargo: "",
    email: "",
    telefono: "",
    ejecutivoamazon: "",
    website: "",
  });

  useEffect(() => {
    GetSeller(idcliente).then((response) => {
      setprofile(response);
    });
  }, [idcliente]);

  console.log("PICO1", profile)
  return (

   <div>
       <SellerUpdateForm2 profile={profile} setprofile={setprofile} idcliente ={idcliente}></SellerUpdateForm2>
   </div>
  )

};

export default SellerUpdateForm;
